import { createChatBotMessage } from "react-chatbot-kit";

const config = {
  initialMessages: [
    createChatBotMessage("Hi! I'm GaureshBot. How can I assist you?")
  ],
  botName: "GaureshBot",
  customStyles: {
    botMessageBox: { backgroundColor: "#333" },
    chatButton: { backgroundColor: "#007bff" }
  },
};

export default config;
